export function recoverLibraries(data: Array<string>): void {
  if (data.length != libraries.length) {
    console.log("> Node: unmatched length ", data.length, libraries.length);
    return;
  }

  for (let i = 0; i < libraries.length; i++) {
    libraries[i].address = data[i];
  }
}

